class Solution(object):
    def numberOfSubstrings(self, s):
        """
        :type s: str
        :rtype: int
        """
        count=[]
        now ={
            'a' : 0,
            'b':0,
            'c' :0
        }
        import  copy
        count.append(copy.deepcopy(now))
        for i in s:
            if i in now:
                now[i] +=1
            count.append(copy.deepcopy(now))

        ans  =0
        # print(count[3])
        # print(count[0])
        next=0
        for i in range(0, len(s)+1):
            j =i
            while j < len(s) +1:
                print(i, j)

                j = max(j, next)

                JC = count[j]
                iC = count[i]
                if JC['a'] - iC['a'] >0 and JC['b'] - iC['b'] >0 and JC['c'] - iC['c'] >0 :
                    ans += len(s) - j +1
                    # print(i, j)
                    break
                else:  # 剪枝跳过没必要的计算
                    next = max(next, j)

                j +=1




        print(ans)
        return ans


Solution.numberOfSubstrings(None,s = "")